import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

ReactDOM.render(
  <Router>
    <Switch>
      <Route exact path="/" component={Homepage}/>
      <Route exact path="/about" component={Aboutpage }/>
    </Switch>
  </Router>,
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
